import React, { useState, useEffect } from "react";
import { Button, Select, Container, Stack, Autocomplete, TextField, Divider, FormLabel, Grid, Box, InputLabel, MenuItem } from '@mui/material';
import { CacheProvider } from "@emotion/react";
import axios from 'axios';
import { USERS_URL } from './Constants';

function StockMonitor() {

  const [sources, setStockSources] = useState([]);
 // const [firstName, setFirstName] = useState();
  const [id, setId] = useState();

  useEffect(() => {
    loadStockSources().then(
      console.log('loaded....')
    )

    //incrementValue()
    //console.log("increment --> " + counter)


  }, []);

  const loadStockSources = async () => {
    const response = await axios.get(USERS_URL)
    console.log(response.data.data);
    setStockSources(response.data.data);
  }

  const handleChange = (event, object) => {
    let target = object.props;
    let value_ = target.value;
    setId(value_)
    console.log(value_);

  }

  return (
    <Container maxWidth="xs" >
      <Stack spacing={1} marginTop={2}>
        <Grid container spacing={0}>
          <Grid item xs={6}>
            <InputLabel>Price Source:</InputLabel>
          </Grid>
          <Grid item xs={6}>
            <Select
              labelId="demo-simple-select-label"
              id="select-source"
              value={id}
              //label="Age"
              defaultValue={1}
              variant="outlined"
              sx={{ width: 200 }}
              onChange={handleChange}
              displayEmpty
              placeholder={"slect the source"}
            >
              { sources.map(({first_name, email, last_name, id},index) => (
                <MenuItem key={index} value={id}>{first_name} {last_name}</MenuItem>
              ))}
            </Select>
          </Grid>
        </Grid>
        <Grid container spacing={0}>
          <Grid item xs={6}>
            <FormLabel>Ticker:</FormLabel>
          </Grid>
          <Grid item xs={6}>
            <Select
              labelId="demo-simple-select-label"
              id="select-ticker"
              value={id}
              //label="Age"
              defaultValue={1}
              variant="outlined"
              sx={{ width: 200 }}
              onChange={handleChange}
            >
              { sources.map(({first_name, email, last_name, id},index) => (
                <MenuItem key={index} value={id}>{first_name} {last_name}</MenuItem>
              ))}
            </Select>
          </Grid>
        </Grid>
      </Stack>
    </Container>
  );

}

export default StockMonitor;
